import{_ as e,o,c as t,a}from"./app.fdb347c4.js";const u=JSON.parse('{"title":"Git","description":"","frontmatter":{},"headers":[{"level":2,"title":"Basic Usage","slug":"basic-usage","link":"#basic-usage","children":[{"level":3,"title":"Configure Git","slug":"configure-git","link":"#configure-git","children":[]},{"level":3,"title":"Create repositories","slug":"create-repositories","link":"#create-repositories","children":[]},{"level":3,"title":"Git Ignore","slug":"git-ignore","link":"#git-ignore","children":[]}]},{"level":2,"title":"Commonly Used commands","slug":"commonly-used-commands","link":"#commonly-used-commands","children":[]}],"relativePath":"getting-started/git.md"}'),s={name:"getting-started/git.md"},i=a(`<h1 id="git" tabindex="-1">Git <a class="header-anchor" href="#git" aria-hidden="true">#</a></h1><ul><li><a href="https://git-scm.com/docs" target="_blank" rel="noreferrer">Documentation</a></li></ul><p>Git is an open-source version control system for software development. Git allows developers to track changes to their codebase over time, collaborate with others on software projects, and manage multiple versions of a codebase simultaneously. It works by creating a &quot;repository&quot; that stores all of the code and version history for a project, and allowing users to &quot;commit&quot; changes to the repository, along with a message describing the changes.</p><p>Git also provides tools for collaborating with other developers on a project, such as &quot;pull requests&quot; and &quot;branches&quot; that allow developers to propose changes and collaborate on new features without disrupting the main codebase.</p><p>One of the key benefits of using Git is that it allows developers to easily manage and merge multiple versions of a codebase, even if those versions have diverged significantly over time. It also provides powerful tools for undoing changes, reverting to earlier versions of a codebase, and managing conflicts that can arise when multiple developers are working on the same code.</p><ul><li><a href="https://git-scm.com/book/en/v2" target="_blank" rel="noreferrer">Book</a></li></ul><h2 id="basic-usage" tabindex="-1">Basic Usage <a class="header-anchor" href="#basic-usage" aria-hidden="true">#</a></h2><h3 id="configure-git" tabindex="-1">Configure Git <a class="header-anchor" href="#configure-git" aria-hidden="true">#</a></h3><p>Sets the name you want attached to your commit transactions</p><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki material-palenight"><code><span class="line"><span style="color:#FFCB6B;">$</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">git</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">config</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">--global</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">user.name</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">{{name}}</span><span style="color:#89DDFF;">&quot;</span></span>
<span class="line"></span></code></pre></div><p>Sets the email you want attached to your commit transactions</p><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki material-palenight"><code><span class="line"><span style="color:#FFCB6B;">$</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">git</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">config</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">--global</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">user.email</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">{{email_address}}</span><span style="color:#89DDFF;">&quot;</span></span>
<span class="line"></span></code></pre></div><h3 id="create-repositories" tabindex="-1">Create repositories <a class="header-anchor" href="#create-repositories" aria-hidden="true">#</a></h3><p>A new repository can either be created locally, or an existing repository can be cloned.</p><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki material-palenight"><code><span class="line"><span style="color:#FFCB6B;">$</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">git</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">init</span></span>
<span class="line"></span></code></pre></div><p>The git init command creates a new folder in your directory called <code>.git</code>.</p><h3 id="git-ignore" tabindex="-1">Git Ignore <a class="header-anchor" href="#git-ignore" aria-hidden="true">#</a></h3><p>In a git folder, it is important to add a <code>.gitignore</code> in your folder to specify which files should be excluded from being tracked with Git.</p><ul><li><a href="https://github.com/github/gitignore" target="_blank" rel="noreferrer">Gitignore Files</a></li></ul><h2 id="commonly-used-commands" tabindex="-1">Commonly Used commands <a class="header-anchor" href="#commonly-used-commands" aria-hidden="true">#</a></h2><ul><li><code>git init</code>: Initializes a new Git repository in the current directory.</li><li><code>git clone</code>: Makes a copy of a remote Git repository to your local machine.</li><li><code>git add</code>: Adds changes to the staging area, preparing them to be committed.</li><li><code>git commit</code>: Commits changes to the local repository, creating a new version of the code with a message describing the changes.</li><li><code>git push</code>: Sends committed changes to a remote repository, typically on a server like GitHub.</li><li><code>git pull</code>: Updates the local repository with changes from the remote repository.</li><li><code>git branch</code>: Lists all local branches in the repository.</li><li><code>git checkout</code>: Switches between different branches in the repository.</li><li><code>git merge</code>: Combines changes from one branch into another branch.</li><li><code>git stash</code>: Temporarily saves changes that are not yet ready to be committed.</li><li><code>git log</code>: Displays a log of all the commits made to the repository.</li><li><code>git status</code>: Shows the current status of the repository, including which files have been modified, added, or deleted.</li><li><code>git remote</code>: Lists the remote repositories that are currently connected to the local repository.</li><li><code>git fetch</code>: Downloads changes from the remote repository, but does not merge them into the local repository.</li></ul>`,21),n=[i];function r(l,c,d,p,h,g){return o(),t("div",null,n)}const y=e(s,[["render",r]]);export{u as __pageData,y as default};
